import React from "react";
import './TransactionForm.css'
import Button from "../Button/Button";
import Title from "../Title/Title";
const TransactionForm = ()=>{
    const [newTitle , setnewTitle]=use
    return (
    <div>
       <form className="formDetail">
           <Title value={"Add new transaction"}/>
           
           <label>Text</label> 
           <input className="input" type="text" placeholder="Enter text..." />
           <label>Amount 
                <br/>
                {`(negative-expense , positive-income)`}
           </label>
           <input className="input" type="text" placeholder="Enter amount..." />
           <Button type="submit" buttonValue="Add transaction"></Button>
       </form>

    </div>
    );
}

export default TransactionForm ;
